import React from 'react';
import './App.css'; // Import your CSS file
import busImage from './images/busOne.jpg'; // Import or specify the path to your background image

function signUp() {
  alert('You clicked me!');
}

function Gallery() {
  const backgroundStyle = {
    backgroundImage: `url(${busImage})`, // Use the imported image or specified path
    backgroundSize: 'cover', // Adjust the size as needed
    backgroundRepeat: 'no-repeat', // Prevent image repeating
    minHeight: '100vh', // Ensure the section covers the viewport height
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    color: 'white', // Text color
    textAlign: 'center',
  };

  return (
    <div style={backgroundStyle} className="container">
      <h1 className="header">Welcome to UW Bus Buddies - Connecting Commuters!</h1>
      <p className="paragraph">Join us to find your commuting buddy.</p>
      <h2 className="header">Who We Are</h2>
      <p className="paragraph">We are...</p>
      <h2 className="header">Join Us</h2>
      <button onClick={signUp} className="btn btn-primary">Sign Up</button>
    </div>
  );
}

export default Gallery;
